import { Route, Routes } from 'react-router-dom';

import gensek from './assets/data/genseks.json';
import imperors from './assets/data/imperors.json';
import tsars from './assets/data/tsars.json';
import { PageWithBlocks } from './PageWithBlocks';
import { MainPage } from './MainPage';
import { BlockProps } from './Block';

const we: BlockProps[] = [
    {
        title: 'О создателях проекта',
        leaders: [
            {
                name: 'Титаренко Арсений',
                years: 'БПИ2310',
                image: './assets/img/Pechenev.jpg',
                info: [
                    'tg: @bibbob'
                ]
            },
            {
                name: 'Печенев Платон',
                years: '',
                image: './assets/img/Pechenev.jpg',
                info: [
                    'tg: @bibbob'
                ]
            }
        ]
    }
]
function App() {
    return <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/tsars" element={<PageWithBlocks blocks={tsars} />} />
        <Route path="/gensek" element={<PageWithBlocks blocks={gensek} />} />
        <Route path="/imperors" element={<PageWithBlocks blocks={imperors} />} />
        <Route path="/creators" element={<PageWithBlocks blocks={we} />} />
    </Routes>
}

export default App;
